import React from "react";
import SearchBar from "../searchBar/SearchBar.jsx";
import { NavLink } from "react-router-dom";

const Nav = ({onSearch})=>{
  return (
    <div className="navConten">
      <div>
      <NavLink to='/about'>
    <button>About</button>
    </NavLink>
    <NavLink to='/home'>
    <button>Home</button>
    </NavLink>
      </div>
    <SearchBar onSearch={onSearch}/>
    <button className="random" onClick={random}>
        ADD RANDOM
      </button>
    </div>
  )
}

export default Nav;
